import React, { Component } from 'react'

export default class Item extends Component {
    
    render() {
        let {item} = this.props
        return (
            <div className="item">
                <h3>{item.name}</h3>
                {
                    item.foods && item.foods.map((i,ind)=>{
                        return (
                            <dl key={ind}>
                                <dt>
                                    <img src={item.image} alt=""/>
                                </dt>
                                <dd>
                                    <p>{i.name}</p>
                                    <p>{i.description}</p>
                                    <p>{i.price}</p>
                                </dd>
                            </dl>
                        )
                    })
                }
        </div>
        )
    }
}
